import React from 'react';
import images from '../exports/images';
import '../styles/slider.css';
import { motion } from 'framer-motion';

const Slider = () => {
  return (
    <motion.div className="slider-container">
      <h1>Fotos</h1>
      {images.map((image) => (
        <img src={image} alt="" />
      ))}
    </motion.div>
  );
};

export default Slider;
